class Home extends React.Component {
  constructor(){
    super();
    this.state = {
      students : []
    }
  }
  componentDidMount() {
    axios.get("http://127.0.0.1:8000/students/")

  }
  render(){
    return (

      <div className="Home">


        <main className="Home-main">
         <ul>
           {this.state.students}
        </ul>
        </main>
      </div>
    );
  }

}

export default Home;
